import {
	Container,
	BreadcrumbItem,
	Row,
	Col,
	Breadcrumb,
	Card,
	CardHeader,
	CardTitle,
	CardImg,
	CardBody,
	CardFooter,
	Button,
	Form,
	FormInput,
	FormGroup,
	Collapse,
	Badge
} from 'shards-react';
import Head from 'next/head';
import { BrowserView, MobileView, isBrowser, isMobile } from 'react-device-detect';
import SEO from 'react-seo-component';
import Img from 'react-image';

// Layout
import Layout from '../components/Layout';

const ulStyles = {
	marginLeft: '-30px',
	listStyleType: 'none'
};

const liStyle = { paddingBottom: '15px' };

class Guide extends React.Component {
	constructor(props) {
		super(props);

		this.state = { collapse: false };
	}

	render() {
		return (
			<Layout>
				<Head>
					<title>Guides | CXC Spanish Guide</title>
					<meta name="og:title" content="Guides |  CXC Spanish Guide" />
					<meta name="og:site_name" content="CXC Spanish Online" />
					<meta
						name="description"
						content="Take your Spanish to the next level with detailed lesson guides, completed with examples and practice questions."
					/>
				</Head>
				<Container>
					<Breadcrumb>
						<BreadcrumbItem>
							<a href="/">Home</a>
						</BreadcrumbItem>
						<BreadcrumbItem active>Guides</BreadcrumbItem>
					</Breadcrumb>

					<Row>
						<Col sm={8} md={8} lg={8} xl={8}></Col>
						<Col sm={4} md={4} lg={4} xl={4}></Col>
					</Row>
				</Container>
			</Layout>
		);
	}
}

export default Guide;
